- description: "Optional mapping of IDs to 2D coordinates used by the UX for\nvisualization.\n\
    \n   The map keys are string identifiers (for example, a cluster id or a sample\
    \ id)\n   and the values are the coordinates and visual size for rendering on\
    \ a 2D chart.\n\n   This property is omitted unless the client requests coordinates\
    \ (for example,\n   by passing `includeCoordinates=true` as a query parameter).\n\
    \n   Example:\n\n<!-- literal_block {\"ids\": [], \"classes\": [], \"names\":\
    \ [], \"dupnames\": [], \"backrefs\": [], \"xml:space\": \"preserve\", \"force\"\
    : false, \"language\": \"default\", \"highlight_args\": {}, \"linenos\": false}\
    \ -->\n\n````default\n\n    {\n      \"cluster-1\": { \"x\": 12, \"y\": 34, \"\
    size\": 8 },\n      \"sample-123\": { \"x\": 18, \"y\": 22, \"size\": 4 }\n  \
    \  }\n\n   Coordinates are intended only for client-side visualization and do\
    \ not\n   modify the canonical insights results.\n   ````"
  name: coordinates
  types:
  - <xref:dict>[<xref:str>, <xref:azure.ai.projects.models.ChartCoordinate>]
